DROP TABLE IF EXISTS `ledger`;
CREATE TABLE `ledger` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `ledger_date` date NOT NULL COMMENT '台账日期',
  `cust_id` int(8) NOT NULL COMMENT '客户ID',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '收发货金额',
  `receipt_refund` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前客户的业务员收退款总金额',
  `last_carry_down` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '客户上月结转',
  `cust_balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '客户余额（即本月结转）',
  `status` tinyint(2) NOT NULL COMMENT '状态。0：未冻结，1：已冻结，2：已审核',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `lc` (`ledger_date`,`cust_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='台账汇总';

