  `cust_region_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '客户区域编码',
  `cust_region_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '客户区域全名',
  `cust_id` int(8) NOT NULL COMMENT '客户ID',
  `cust_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '客户名称',
  `cust_type` tinyint(2) NOT NULL COMMENT '客户类型',
  `ledger_type_id` tinyint(2) NOT NULL COMMENT '台账类型ID。1：发货，2：退货，3：收款，4：退款',
  `goods_id` int(8) DEFAULT NULL COMMENT '商品ID',
  `goods_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '商品编码',
  `goods_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '品种（商品名）',
  `tun_per_price` decimal(10,2) DEFAULT NULL COMMENT '标准吨价',
  `qty` decimal(10,2) DEFAULT '0.00' COMMENT '数量（吨）',
  `unit_price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `amount` decimal(10,2) DEFAULT '0.00' COMMENT '金额。收货、退货金额',
  `trans_fee` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `sales_mode_id` tinyint(3) DEFAULT NULL COMMENT '销售方式ID',
  `sales_mode_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '销售方式名称',
  `spread_price` decimal(10,2) DEFAULT '0.00' COMMENT '包材品种差价',
  `sys_spread_price` decimal(10,2) DEFAULT NULL COMMENT '包材品种差价(系统计算)',
  `discount_price` decimal(10,2) DEFAULT '0.00' COMMENT '折后出厂价',
  `sys_discount_price` decimal(10,2) DEFAULT NULL COMMENT '折后出厂价（系统计算）',
  `profit_rate` float DEFAULT '0' COMMENT '提成系数',
  `sys_profit_rate` float DEFAULT NULL COMMENT '提成系数(系统计算)',
  `profit_amount` decimal(10,2) DEFAULT '0.00' COMMENT '提成金额',
  `sys_profit_amount` decimal(10,2) DEFAULT NULL COMMENT '提成金额（系统计算）',
  `sales_fee` decimal(10,2) DEFAULT '0.00' COMMENT '销售费用',
  `market_fee` decimal(10,2) DEFAULT '0.00' COMMENT '市场费用',
  `salt_spread_price` decimal(10,2) DEFAULT '0.00' COMMENT '原盐差价',
  `rebate` decimal(10,2) DEFAULT '0.00' COMMENT '政策返利',
  `receipt_refund` decimal(10,2) DEFAULT '0.00' COMMENT '收退款金额。收款为正，退款为负',
  `addr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '客户地址',
  `remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `sort` int(8) DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `lc` (`ledger_date`,`cust_id`) USING BTREE,
  KEY `ls` (`ledger_date`,`sales_id`) USING BTREE,
  KEY `lsc` (`ledger_date`,`sales_id`,`cust_id`) USING BTREE,
  KEY `l` (`ledger_date`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=215 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='台账明细';

